(13, 1, '2018-03-19 11:55:06', '2018-03-19 11:55:06', 'I do web development and other coding. I am currently in the process of putting something interesting on my own website, and trying to make it look good. In the meantime, take a look at my portfolio or read my resume.\r\n\r\nI am always interested in hearing about new exciting projects or ideas. Send me an email or give me a call!\r\n\r\n&nbsp;', 'Howdy, stranger! Welcome to wallindev.', '', 'publish', 'closed', 'closed', '', 'home', '', '', '2018-03-28 16:45:03', '2018-03-28 14:45:03', '', 0, 'http://wp.wallindev.se/?page_id=13', 0, 'page', '', 0),
